 5.00&lt;/b&gt;&lt;/blockquote&gt;&lt;br&gt;&lt;br&gt;&lt;p&gt;4. Hitung nilai Consistency Index (CI)&lt;/p&gt;&lt;blockquote class=&#039;quote-primary&#039;&gt;&lt;b&gt;CI = (λ &lt;sub&gt;maks&lt;/sub&gt; - n) / n - 1&lt;br&gt;CI = (5.00 - 5) / (5 - 1) = 0.00&lt;/b&gt;&lt;/blockquote&gt;&lt;br&gt;&lt;br&gt;&lt;p&gt;5. Hitung nilai Consistency Ratio (CR) berdasarkan nilai Random Index (RI)&lt;/p&gt;&lt;table class=&#039;table table-striped table-bordered&#039;&gt;&lt;tr align=&#039;center&#039; valign=&#039;middle&#039;&gt;&lt;th rowspan=&#039;2&#039; valign=&#039;middle&#039;&gt;RI&lt;/th&gt;&lt;th&gt;1&lt;/th&gt;&lt;th&gt;2&lt;/th&gt;&lt;th&gt;3&lt;/th&gt;&lt;th&gt;4&lt;/th&gt;&lt;th class=&#039;bg-green&#039;&gt;5&lt;/th&gt;&lt;th&gt;6&lt;/th&gt;&lt;th&gt;7&lt;/th&gt;&lt;th&gt;8&lt;/th&gt;&lt;th&gt;9&lt;/th&gt;&lt;th&gt;10&lt;/th&gt;&lt;th&gt;11&lt;/th&gt;&lt;th&gt;12&lt;/th&gt;&lt;th&gt;13&lt;/th&gt;&lt;th&gt;14&lt;/th&gt;&lt;th&gt;15&lt;/th&gt;&lt;/tr&gt;&lt;tr align=&#039;center&#039;&gt;&lt;td&gt;0&lt;/td&gt;&lt;td&gt;0&lt;/td&gt;&lt;td&gt;0.58&lt;/td&gt;&lt;td&gt;0.9&lt;/td&gt;&lt;td class=&#039;bg-green&#039;&gt;1.12&lt;/td&gt;&lt;td&gt;1.24&lt;/td&gt;&lt;td&gt;1.32&lt;/td&gt;&lt;td&gt;1.41&lt;/td&gt;&lt;td&gt;1.45&lt;/td&gt;&lt;td&gt;1.49&lt;/td&gt;&lt;td&gt;1.51&lt;/td&gt;&lt;td&gt;1.48&lt;/td&gt;&lt;td&gt;1.56&lt;/td&gt;&lt;td&gt;1.57&lt;/td&gt;&lt;td&gt;1.59&lt;/td&gt;&lt;/tr&gt;&lt;/table&gt;&lt;br&gt;&lt;p&gt;&lt;blockquote class=&#039;quote-primary&#039;&gt;&lt;b&gt;CR = CI / RI&lt;br&gt;CR = 0.00 / 1.12 = 0.0000&lt;/b&gt;&lt;/blockquote&gt;&lt;/p&gt;&lt;br&gt;Nilai &lt;b&gt;0.0000&lt;/b&gt; ini menyatakan bahwa rasio konsistensi dari hasil penilaian pembandingan di atas mempunyai rasio &lt;b&gt;0%&lt;/b&gt;. Sehingga penilaian di atas&lt;b&gt; dapat diterima karena lebih kecil &lt;/b&gt;dari 10% (Saaty).&lt;/div&gt;&lt;/div&gt;	&lt;/div&gt;
